import React from 'react';

import {DrHistoryTable} from './drHistoryTable';
import {DrOnGoingTable} from './drOnGoingTable';
import {DrRequestTable} from './drRequestTable'

export class DrCaseManagement extends React.Component
{
  render() {
      return(
          <div>
              <DrOnGoingTable />
              <DrRequestTable />
              <DrHistoryTable />
          </div>
      );
  }
};
